    [],nt"num_tags": 5,nt"name": "revised-comprehensive-conservation-plan-and-environmental-impact-statement-volumes-1-and-2",nt"isopen":
    false,nt"url": null,nt"notes": "This Revised Comprehensive Conservation
    Plan (Plan) and Environmental Impact Statement (EIS) for the Kenai National Wildlife
    Refuge will guide management of the Refuge for the next 15 years.This Plan revises
    the Refugeu2019s original comprehensive conservation plan completed in 1985. It
    outlines five management alternatives, including our preferred alternative, addresses
    management issues raised during public scoping, and presents our evaluation of the
    impacts associated with implementing each alternative. This Plan has been published
    in two volumes. Volume 1 contains the background, issues, and analysis. Volume 2
    contains the supporting appendices. This Plan incorporates changes based on comments
    received on the Draft Plan. Those comments and our responses are presented in Volume
    2, Appendix D. Most comments required only that we clarify or make minor corrections
    to the text. Others were more involved. For example, Objective 2.9 was rewritten
    to remove the population objectives for Dall sheep and mountain goats in response
    to concerns expressed by the State of Alaska. Another change was to propose a change
    in regulations to allow the Refuge Manager to grant special use permits, for airplane
    access to normally closed lakes, to successful applicants in the Stateu2019s limited
    drawing hunt program.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
